import React, { Component } from 'react';

class HeroItems extends Component {
    renderImage(i) {
        return (
            <Item
                value={this.props.item[i]}
            />
        );
    }

    render() {
        return (
            <div className="hero-items__container">
                <div>
                    <div className="image-row">
                        {this.renderImage(0)}
                        {this.renderImage(1)}
                        {this.renderImage(2)}
                    </div>
                    <div className="image-row">
                        {this.renderImage(3)}
                        {this.renderImage(4)}
                        {this.renderImage(5)}
                    </div>
                    <div className="image-row">
                        {this.renderImage(6)}
                        {this.renderImage(7)}
                        {this.renderImage(8)}
                    </div>
                    <div className="image-row">
                        {this.renderImage(9)}
                        {this.renderImage(10)}
                        {this.renderImage(11)}
                    </div>
                </div>
            </div>
        );
    }
}

export default HeroItems;
